import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent {
    constructor(private router: Router){}
    submit(){
      this.router.navigate(['/login'])
    }
    home2(){
      this.router.navigate(['/home'])

    }
}
<!DOCTYPE html>
<html>
  <style>
    h2{
      text-align: center;
    }
  </style>
  <head>
    <script>
    function validateForm() {
      let x = document.forms["myForm"]["name"].value;
      if (x == "") {
        alert("Name must be filled out");
        return false;
      }
    }
    </script>
    </head>
<body>
  <input type="submit" value="HOME" (click)="home2()">
<h2>SIGN UP Page</h2>

<form  name="myForm" class="c" onsubmit="return validateForm()" method="post">

  <div>
  First name: 
  <br><input type="text" id="fname" name="fname" ><br>

  Last name: <br>
   <input type="text" id="lname" name="lname" ><br>
   Email: <br>
   <input type="text" id="em" name="email" ><br>
   Password: <br>
   <input type="text" id="pw" name="password" ><br><br>
  <input type="submit" value="Submit" (click)="submit()" >
</div>
</form> 



</body>
</html>
